import React, { Component } from "react";
import http from "./httpService";
class NewEmployee extends Component {
  state = {
    employee: { id:"",empCode: "", name: "", department: "", designation: "", salary:"",gender:"" },
    deptOpt : ["Finance", "HR", "Technology","Marketing"],
    desigOpt :  ["VP", "Manager", "Trainee"],
  };
 handleChange = (e) => {
    const { currentTarget: input } = e;
    let s1 = { ...this.state };
    s1.employee[input.name] = input.value;
    this.setState(s1);
  };
 async postData(url, obj) {
    let response = await http.post(url, obj);
    let {data} = response;
    console.log(data);
    this.props.history.push("/employees");
  }

  handleSubmit = (e) => {
    e.preventDefault();
     this.postData("/employees", this.state.employee);
  };

  render() {
    let { id,empCode,name,department,designation,salary,gender } = this.state.employee;
    const { deptOpt,desigOpt} = this.state;
    return (
      <div className="container">
        <div className="form-group mt-2">
          <label>Employee Id</label>
          <input
            type="text"
            className="form-control"
            id="id"
            name="id"
            placeholder="Enter id"
            value={id}
            onChange={this.handleChange}
          />
        </div>
        <br/>
        <div className="form-group mt-2">
          <label>Employee Code</label>
          <input
            type="text"
            className="form-control"
            id="empCode"
            name="empCode"
            placeholder="Enter Code"
            value={empCode}
            onChange={this.handleChange}
          />
        </div>
        <br/>
        <div className="form-group">
        <label>Name</label>
        <input
          type="text"
          className="form-control"
          id="name"
          name="name"
          placeholder="Enter Name"
          value={name}
          onChange={this.handleChange}
        />
      </div><br/>
        <div className="form-group">
        <label>Department</label>
          <select
            className="form-control"
            id="department"
            name="department"
            value={department}
            onChange={this.handleChange}
          >
            <option disabled value="">Select Department</option>
            {deptOpt.map((opt) => (
              <option>{opt}</option>
            ))}
          </select>
          <br />
        </div>
        <div className="form-group">
        <label>Designation</label>
          <select
            className="form-control"
            id="designation"
            name="designation"
            value={designation}
            onChange={this.handleChange}
          >
            <option disabled value="">Select Designation</option>
            {desigOpt.map((opt) => (
              <option>{opt}</option>
            ))}
          </select>
          <br />
        </div>
        <div className="form-group">
        <label>Salary</label>
        <input
          type="text"
          className="form-control"
          id="salary"
          name="salary"
          placeholder="Enter Salary"
          value={salary}
          onChange={this.handleChange}
        />
      </div><br/>
      <div className="form-check form-check-inline">
            <input type="radio" className="form-check-input" name="gender"  value="Male" checked={gender==="Male"}  onChange={this.handleChange}/>
            <label className="form-check-label">Male</label>
        </div>
        <div className="form-check form-check-inline">
            <input type="radio" className="form-check-input" name="gender"  value="Female" checked={gender==="Female"}  onChange={this.handleChange}/>
            <label className="form-check-label">Female</label>
        </div><br/>
          
        <button className="btn btn-primary mt-2" onClick={this.handleSubmit}>
          Submit
        </button>
      </div>
    );
  }
}
export default NewEmployee;
